import React from 'react';
import { useEffect, useState } from 'react';
import './App.css';

import airforce from './airforce.png';

const App = () => {

  return (

    <div className='App'>

      <div className='textContainer'>
          <h1>Main text</h1>
          <h2>Secondary text</h2>
      </div>
        <img className='logo' src={airforce} />

    </div>

  );

}

export default App;
